export const addTodoAction = (todo) => ({
  type: "ADD_TODO",
  payload: todo,
});

export const toggleTodoAction = (todoId) => ({
  type: "TOGGLE_TODO",
  payload: todoId,
});

export const DeleteTodoAction = (todoId) => ({
  type: "DELETE_TODO",
  payload: todoId,
});
